 (\n                                \"            label={t`${it.frontName}`} hasFeedback {...formItemLayout}>\\n\" +\n                                        \"            <InputNumber\\n\" )\n                        //校验规则\n//                        if(min) code += (\" minLenght={${min}}\")\n//                        if(max) code += (\" maxLength={${max}}\")\n                        if(it.frontMax) code += (\" max={${it.frontMax}}\")\n                        if(it.frontStep) code += (\" step=\\\"${it.frontStep}\\\"\")\n                        code += (\"  style={{width:200}}\")\n                        code += \"             disabled={${it.editReadOnly}}\\n\"\n                        code += (\" />\\n\")\n                    } else if (frontType == \'editor\') {\n                        code += (\n                                \"           label={t`${it.frontName}`} hasFeedback {...formItemLayout}>\\n\" +\n                                        \"           <QuillEditor disabled={${it.editReadOnly}} />\\n\"\n                        )\n                    } else if(frontType == \'password\') {\n                        code += (\n                                \"            label={t`${it.frontName}`} hasFeedback {...formItemLayout}>\\n\" +\n                                        \"            <Input.Password\\n\" )\n                        //校验规则\n                        if(min) code += (\" minLenght={${min}}\")\n                        if(max) code +=(\" maxLength={${max}}\")\n                        code += \"             disabled={${it.editReadOnly}}\\n\"\n                        code += (\" />\\n\")\n                    } else if (frontType == \'textArea\') {\n                        code += (\n                                \"            label={t`${it.frontName}`} hasFeedback {...formItemLayout}>\\n\" +\n                                        \"            <TextArea\" )\n                        code += \"             disabled={${it.editReadOnly}}\\n\"\n  